SELECT AVG("title"."episode_nr" + "char_name"."id") as agg_0 FROM "name" LEFT OUTER JOIN "aka_name" ON "name"."id" = "aka_name"."person_id" LEFT OUTER JOIN "cast_info" ON "aka_name"."id" = "cast_info"."person_id" LEFT OUTER JOIN "title" ON "cast_info"."movie_id" = "title"."id" LEFT OUTER JOIN "movie_info_idx" ON "title"."id" = "movie_info_idx"."movie_id" LEFT OUTER JOIN "movie_companies" ON "title"."id" = "movie_companies"."movie_id" LEFT OUTER JOIN "char_name" ON "cast_info"."person_role_id" = "char_name"."id" LEFT OUTER JOIN "kind_type" ON "title"."kind_id" = "kind_type"."id" LEFT OUTER JOIN "company_name" ON "movie_companies"."company_id" = "company_name"."id" LEFT OUTER JOIN "info_type" ON "movie_info_idx"."info_type_id" = "info_type"."id"  WHERE "info_type"."info" NOT LIKE '%quality%' AND "movie_info_idx"."movie_id" <= 2304384 AND "company_name"."country_code" != '[tm]' AND "aka_name"."person_id" <= 2160315 AND "movie_companies"."note" NOT LIKE '%(DVD)%' AND "title"."title" LIKE '%of%';
SELECT AVG("title"."production_year") as agg_0 FROM "title" LEFT OUTER JOIN "movie_info_idx" ON "title"."id" = "movie_info_idx"."movie_id" LEFT OUTER JOIN "movie_keyword" ON "title"."id" = "movie_keyword"."movie_id" LEFT OUTER JOIN "kind_type" ON "title"."kind_id" = "kind_type"."id" LEFT OUTER JOIN "movie_info" ON "title"."id" = "movie_info"."movie_id" LEFT OUTER JOIN "cast_info" ON "title"."id" = "cast_info"."movie_id"  WHERE "movie_info_idx"."info" LIKE '%7%.8%' AND "movie_info"."info" LIKE '%E%nglish%' AND "kind_type"."id" BETWEEN 3 AND 5 AND "cast_info"."note" NOT LIKE '%(arch%ive%';
SELECT SUM("movie_companies"."company_id" + "movie_info_idx"."id") as agg_0 FROM "info_type" LEFT OUTER JOIN "movie_info_idx" ON "info_type"."id" = "movie_info_idx"."info_type_id" LEFT OUTER JOIN "title" ON "movie_info_idx"."movie_id" = "title"."id" LEFT OUTER JOIN "movie_info" ON "title"."id" = "movie_info"."movie_id" LEFT OUTER JOIN "cast_info" ON "title"."id" = "cast_info"."movie_id" LEFT OUTER JOIN "kind_type" ON "title"."kind_id" = "kind_type"."id" LEFT OUTER JOIN "char_name" ON "cast_info"."person_role_id" = "char_name"."id" LEFT OUTER JOIN "aka_name" ON "cast_info"."person_id" = "aka_name"."id" LEFT OUTER JOIN "movie_companies" ON "title"."id" = "movie_companies"."movie_id" LEFT OUTER JOIN "company_type" ON "movie_companies"."company_type_id" = "company_type"."id"  WHERE "kind_type"."id" BETWEEN 2 AND 3 AND "title"."title" LIKE '%and%';
SELECT MAX("cast_info"."movie_id" + "movie_companies"."movie_id") as agg_0 FROM "company_type" LEFT OUTER JOIN "movie_companies" ON "company_type"."id" = "movie_companies"."company_type_id" LEFT OUTER JOIN "company_name" ON "movie_companies"."company_id" = "company_name"."id" LEFT OUTER JOIN "title" ON "movie_companies"."movie_id" = "title"."id" LEFT OUTER JOIN "cast_info" ON "title"."id" = "cast_info"."movie_id"  WHERE "company_type"."id" BETWEEN 2 AND 3 AND ("company_name"."country_code" NOT LIKE '%[d%e]%' OR "company_name"."id" <= 115751 OR "company_name"."country_code" = '[ro]');
SELECT MIN("movie_companies"."id" + "movie_info"."movie_id") as agg_0 FROM "company_name" LEFT OUTER JOIN "movie_companies" ON "company_name"."id" = "movie_companies"."company_id" LEFT OUTER JOIN "company_type" ON "movie_companies"."company_type_id" = "company_type"."id" LEFT OUTER JOIN "title" ON "movie_companies"."movie_id" = "title"."id" LEFT OUTER JOIN "movie_info" ON "title"."id" = "movie_info"."movie_id"  WHERE "movie_info"."info" NOT LIKE '%French%' AND "company_name"."name" LIKE '%Fil%m%' AND "movie_companies"."note" LIKE '%(UK)%' AND "title"."kind_id" = 1 AND "movie_info"."id" BETWEEN 3249514 AND 14297394;
SELECT MIN("movie_info_idx"."movie_id") as agg_0 FROM "movie_companies" LEFT OUTER JOIN "title" ON "movie_companies"."movie_id" = "title"."id" LEFT OUTER JOIN "movie_info_idx" ON "title"."id" = "movie_info_idx"."movie_id" LEFT OUTER JOIN "movie_info" ON "title"."id" = "movie_info"."movie_id"  WHERE "movie_info"."info" NOT LIKE '%French%' AND "title"."episode_of_id" BETWEEN 653358.9232292455 AND 1048127.0829325111 AND "movie_info_idx"."info" NOT LIKE '%7.%9%';
SELECT AVG("cast_info"."person_role_id") as agg_0 FROM "movie_keyword" LEFT OUTER JOIN "keyword" ON "movie_keyword"."keyword_id" = "keyword"."id" LEFT OUTER JOIN "title" ON "movie_keyword"."movie_id" = "title"."id" LEFT OUTER JOIN "movie_companies" ON "title"."id" = "movie_companies"."movie_id" LEFT OUTER JOIN "cast_info" ON "title"."id" = "cast_info"."movie_id" LEFT OUTER JOIN "company_name" ON "movie_companies"."company_id" = "company_name"."id"  WHERE "title"."title" NOT LIKE '%Part%' AND "title"."season_nr" >= 1.7569692038964524;
